  false,\n\t\"url\": null,\n\t\"notes\": \"The San Francisco Bay Area stormwater permit
  sets trash control guidelines for discharges through the storm drain system. The
  permit covers Alameda, Contra Costa, Santa Clara, and San Mateo counties and the
  cities of Vallejo, Fairfield, and Suisun City. By February 2012 the permittees must
  provide a baseline trash load estimate, a list of trash hotspots targeted for annual
  cleanup, and an implementation plan for best management practices to meet trash
  reduction milestones over the next decade. A trash reduction crediting program will
  be used to account for best management practice effectiveness. The permit establishes
  goals for trash reduction beginning in 2014 and reaching a zero level by 2022.\",\n\t\"license_title\":
